function AddScriptHead(src, callback) {
    AddScript(src, document.getElementsByTagName('head')[0], callback);
}
function AddScriptBody(src, callback) {
    AddScript(src, document.getElementsByTagName('body')[0], callback);
}
function AddScript(src, target, callback) {
    var script = document.createElement('script');
    script.type = 'text/javascript';
    script.src = src;

    if (callback != null) {
        if (script.readyState) {  //IE
            script.onreadystatechange = function () {
                if (script.readyState == "loaded" ||
                        script.readyState == "complete") {
                    script.onreadystatechange = null;
                    callback();
                }
            };
        } else {  //Others
            script.onload = function () {
                callback();
            };
        }
    }

    target.appendChild(script);
}

